import { flipIncludes } from '../';
describe('flipIncludes', function () {
  it('returns true if array contains item', function () {
    expect(flipIncludes(['a'], 'a')).toEqual(true);
  });
  it('returns false if array does not contain item', function () {
    expect(flipIncludes(['a'], 'b')).toEqual(false);
  });
});